import React, { useContext, useEffect, useState } from 'react'
import IndexLeft from './indexleft/IndexLeft'
import IndexRight from './indexright/indexRight'
import './Home.css'
import { userContext } from '../../store/Context'
import { orderController } from '../../controller/ OrderController'
import { authController } from '../../controller/AuthController'
import { Cartx } from '../../model/Cartx'
import { quanTityOrderContext } from '../../store/ContextOrderQuantity'
export default function Home() {
    const {onSetUserName} = useContext(userContext)
    const {onSetQuantityOrder} = useContext(quanTityOrderContext)
    useEffect(()=>{
        authController.getMe().then(res => {
            onSetUserName(res.nameUser)
          })
    },[])
    const [listCartItem, setListCartItem] = useState<Cartx[]>([])

    useEffect(() => {
        orderController.listCart(3).then(res =>{
            setListCartItem(res)    
        })
        onSetQuantityOrder(listCartItem.length)

    },[])
    return (
        <div>     
           <IndexRight/>
        </div>
    )
}
